import React from 'react';

const Contact = () => {
  return (
    <section id="contact" className="py-24 px-6 bg-gray-100">
      <div className="max-w-3xl mx-auto text-center">
        <h3 className="text-3xl font-bold mb-6 text-gray-800">Get in Touch</h3>
        <p className="mb-4">Want to work with us? We'd love to hear from you.</p>
        <a href="mailto:contact@finlytiq.com" className="text-blue-700 font-semibold underline">contact@finlytiq.com</a>
      </div>
    </section>
  );
};

export default Contact;
